import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Login from './components/Login';
import Register from './components/Register';
import Footer from './components/Footer';
import PatientDashboard from './components/PatientDashboard';
import DoctorDashboard from './components/DoctorDashboard';
import StaffDashboard from './components/StaffDashboard';
import PromotionSection from './components/PromotionSection';
import MapSection from './components/MapSection';
import ReviewSection from './components/ReviewSection';
import DoctorRecord from './components/DoctorRecord';
import AdminCreate from './components/AdminCreate';
import Invoice from './components/Invoice';
import Report from './components/Report';
import './App.css';

function App() {
  const [user, setUser] = useState(null);

  const handleLogin = (userData) => {
    setUser(userData);
    console.log('User data in App.jsx:', userData); // Debug: ตรวจสอบข้อมูล user
  };

  const handleLogout = () => {
    setUser(null);
    console.log('Logged out');
  };

  return (
    <Router>
      <div className="flex flex-col min-h-screen bg-blue-50">
        <Header user={user} onLogout={handleLogout} />
        <main className="flex-grow container mx-auto p-4">
          <Routes>
            <Route
              path="/"
              element={
                <>
                  <PromotionSection />
                  <MapSection />
                  <ReviewSection />
                </>
              }
            />
            <Route
              path="/login"
              element={<Login onLogin={handleLogin} />}
            />
            <Route
              path="/register"
              element={<Register />}
            />
            <Route
              path="/patient-dashboard"
              element={user && (user.role === 'patient' || !user.role) ? <PatientDashboard user={user} /> : <Login onLogin={handleLogin} />}
            />
            <Route
              path="/doctor-dashboard"
              element={user && user.role === 'doctor' ? <DoctorDashboard user={user} /> : <Login onLogin={handleLogin} />}
            />
            <Route
              path="/staff-dashboard"
              element={user && user.role === 'staff' ? <StaffDashboard user={user} /> : <Login onLogin={handleLogin} />}
            />
            <Route
              path="/doctor-record"
              element={user && user.role === 'doctor' ? <DoctorRecord user={user} /> : <Login onLogin={handleLogin} />}
            />
            <Route
              path="/admin-create"
              element={user && user.role === 'admin' ? <AdminCreate /> : <Login onLogin={handleLogin} />}
            />
            <Route
              path="/invoice"
              element={user ? <Invoice user={user} /> : <Login onLogin={handleLogin} />}
            />
            <Route
              path="/report"
              element={user ? <Report user={user} /> : <Login onLogin={handleLogin} />}
            />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
